export default function ContactList({ contacts, onEdit, onDelete }) {
  if (!contacts || contacts.length === 0) return null;

  return (
    <ul>
      {contacts.map((c) => (
        <li
          key={c._id}
          style={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            padding: "10px 0",
            borderBottom: "1px solid #ddd"
          }}
        >
          <span>
            <strong>{c.name}</strong> â€“ {c.phone}
          </span>

          <div>
            <button
              onClick={() => onEdit(c)}
              style={{
                marginRight: "8px",
                padding: "6px 10px",
                background: "#1976d2",
                color: "#fff",
                border: "none",
                borderRadius: "4px",
                cursor: "pointer"
              }}
            >
              Edit
            </button>

            <button
              onClick={() => onDelete(c._id)}
              style={{
                padding: "6px 10px",
                background: "red",
                color: "#fff",
                border: "none",
                borderRadius: "4px",
                cursor: "pointer"
              }}
            >
              Delete
            </button>
          </div>
        </li>
      ))}
    </ul>
  );
}
